  14,\n\t\"tags\": [],\n\t\"title\": \"Model output for deep-sea coral habitat suitability
  in the U.S. North and Mid-Atlantic from 2013 (NCEI Accession 0145923)\",\n\t\"tracking_summary\":
  {\n\t\t\"total\": 1,\n\t\t\"recent\": 1\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\":
  [],\n\t\"revision_timestamp\": \"2016-04-11T19:08:06.810969\",\n\t\"name\": \"model-output-for-deep-sea-coral-habitat-suitability-in-the-u-s-north-and-mid-atlantic-from-2013\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This dataset was created for potential
  use as an environmental predictor in spatial predictive models of deep-sea coral
  habitat suitability. Deep-sea corals are of particular conservation concern due
  to their slow growth rates and vulnerability to disturbance. This is a derived product.
  Modeling can lend insights into the environmental factors driving the distribution
  of deep-sea corals, helping to build understanding of how these unique ecosystems
  function.nnThis dataset depicts predicted likelihood of suitable habitat for the
  deep-sea corals: Alcyonacea (order), the suborders Calcaxonia, Holaxonia, Scleraxonia,
  Alcyoniina, Stolonifera: of order Alcyonacea; Pennatulacea (order), the suborders
  Sessiliflorae, Subsessiliflorae: of order Pennatulacea; Scleractinia (order), genera
  Dasmosmilia and Desmophyllum: of order Scleractinia, family Caryophylliidae; and
  the family Flabellidae: of order Scleractinia. The dataset also depicts categorical
  seafloor aspect (slope direction) in the U.S. Northeast Atlantic and Mid-Atlantic
  derived from a bathymetry dataset. The likelihood of suitable habitat for deep-sea
  corals of the above order, suborders, genera, and families are depicted by threshold
